                  preview: false,
                  html: 'This ("Agreement") is made and entered into by and between The Flood Team, Inc.,\n a Missouri corporation, d/b/a The Flood Team ("Company") and {{job.customer.firstName}} {{job.customer.lastName}},\n ("Customer"), to provide the services set forth herein.\n    <br>\n    <br>\n    1.    Services.  The Company will provide labor, equipment, and materials to \n    store, preserve, and protect from further damage the property (Property) \n    located at 12430 Tesson Ferry Rd, St. Louis, MO 63128 (Box #377) will attempt \n    to repair and restore any mold related damages.  The Company will evaluate all \n    affected areas, not merely those areas with visible mold and / or damage.\n    <br>\n    <br>\n    2.     Price For Services.\n    (a).  An estimated price for the Services provided by the Company was given prior \n    to this contract.  The Customer acknowledges and agrees that the actual costs for \n    the Services can exceed the Company\'s estimate because it is impossible to accurately \n    estimate the number of days the Services will be required.  Variables, including \n    without limitations, the types of materials that have become molded, the amount of \n    mold that has entered the facility, and the electrical capacity of the facility \n    will affect the remedation times.  The Company will supply documentation of its \n    services if requested by the Customer.\n    <br>\n    <br>\n    (b).   The customer further acknowledges and agrees that all charges for the Services \n    are the personal responsibility and liability of the Customer, and are not conditioned \n    or dependent upon any insurance cover of the Customer.  Services are due and payable \n    thirty (30) days after the Customer receives an invoice for any Services.  Interest \n    shall be charged at a rate of one and one half (1',
