          amp: null,
          html: '<div class="editor-component">{{> o3upLYelkb2DT0OuZRs5}}</div><p class="paragraph"> Service Agreement&nbsp; </p><p class="paragraph"> WATER REMEDIATION SERVICES AGREEMENT&nbsp; </p><p class="paragraph"> This ("Agreement") is made and entered into by and between dba {{location.dba}}, a {{location.address.state}} corporation, d/b/a The Flood Team ("Company") and {{customer.firstName}} {{customer.lastName}} to provide the services set forth herein.&nbsp; </p><p class="paragraph"> 1. Services. The Company will provide labor, equipment, and materials to store, preserve, and protect from further damage the property ("Property") located at {{job.address.full}}. We will attempt to repair and restore carpeting, furniture and other furnishings, and will reduce the indoor humidity (collectively the "Services"). The Company will evaluate all affected areas, not merely those areas with visible water saturation and / or damage.&nbsp; </p><p class="paragraph"> 2. Cost for Services. (a) An estimated price for the Services provided by the Company is ($ currently unknown). The Customer acknowledges and agrees that the actual costs for the Services can exceed the Company’s estimate because it is impossible to accurately estimate the number of days the Services will be required. Variables, including without limitations, the types of materials that have become water saturated, the amount of water that has entered the property, the degree of water saturation, temperature, humidity (indoor and outdoor), and the electrical capacity of the property will affect the drying times. The Company will supply documentation of services if requested by the Customer. (b). The customer further acknowledges and agrees that all charges for the Services are the personal responsibility and liability of the Customer, and are not conditioned or dependent upon any insurance coverage of the Customer. Services are due and payable thirty (30) days after the Customer receives an invoice for any Services. Interest shall be charged at a rate of one and one half (1.5%) percent per month (18% per annum) on all unpaid amounts. The Customer shall pay all attorneys\' fees and costs in the event the Company retains any attorney to collect unpaid amounts.&nbsp; </p><p class="paragraph"> 3. Credit Card Authorization. The Customer hereby authorizes the Company to receive payment for all Services, and/or insurance deductible using the credit card provided. All insurance proceeds, if any, received by the Company, will be deducted from the total amount due and owing. The Company will not charge the Customer\'s credit card until payment is past due, which is thirty one (31) days after the Customer has received an invoice for Services.&nbsp; </p><p class="paragraph"> 4. Agent. The party signing this Agreement as the Customer, covenants, represents and warrants that he or she is duly authorized to sign this Agreement and to act on behalf of and as agent for all owners of the Property.&nbsp; </p><p class="paragraph"> 5. Mold. (a). The Customer is hereby advised that mold, bacterial spores, and other microscopic organisms, which may cause illness, may have existed at or on the Property prior to the commencement of the Services. The Company is not licensed nor is it authorized to identify pre-existing mold, bacterial spores and other microscopic organisms.&nbsp; </p><p class="paragraph"> (b). The Customer acknowledges receiving, reviewing and understanding written material safety information on antimicrobial agents. The Customer is hereby authorizing the Company to use antimicrobial agents to attempt to inhibit the growth of microorganisms. The Customer understands and agrees that it is beyond the expertise of the Company to determine the sensitivity of anyone to antimicrobial agents. The Customer indemnifies, defends and holds harmless the Company, its employees and its agents, from any damages or injuries arising out of the use of antimicrobial agents by the Company.&nbsp; </p><p class="paragraph"> 6. Loss or Damage. The Customer agrees to be responsible and liable for any loss, theft or damage to the equipment of the Company while in the Customer\'s care, custody and control.&nbsp; </p><p class="paragraph"> 7. Delays. The Customer agrees that the Company shall not be liable for delays in the performance of its Services arising out of any circumstance or cause beyond the control of the Company, including without limitation, the inability of the Customer to supply sufficient electricity or obtain materials from usual sources, power outages, weather, labor controversies, fire, strikes, war, and governmental regulations.&nbsp; </p><p class="paragraph"> 8. Procedures. The Customer agrees to indemnify, defend, and hold harmless the Company, its employees and its agents for and against any and all damages, claims or actions that may arise from the Customer i) not allowing the Company to perform its recommended procedures (such as the Customer\'s refusal to remove or place carpeting), ii) requiring the Company to prematurely remove its drying equipment, or iii) preventing the use of antimicrobial agents.&nbsp; </p><p class="paragraph"> 9. Entire Agreement. This Agreement constitutes the entire and only agreement between or among the parties and supersedes any prior written or oral agreement between the parties concerning the subject matter contained herein. There are no representations, agreements or understanding, oral or written, between or among the parties hereto, relating to the subject matter contained in this Agreement, which are not fully expressed herein. This Agreement cannot be changed unless the change is in writing signed by all parties hereto.&nbsp; </p><p class="paragraph"> 10. Binding Effect Upon Successors and Assigns. This Agreement shall be binding upon and shall inure to the benefit of, and shall be enforceable by, the parties and their respective heirs, successors, legal respective heirs, successors, legal representatives and assigns.&nbsp; </p><p class="paragraph"> 11. Customer Representation. The Customer covenants, represents and warrants that the Customer has carefully read this Agreement and understands that the Customer is bound by all of its terms and conditions.&nbsp; </p><p class="paragraph"> IN WITNESS WHEREOF, this Agreement has been duly authorized, made, executed and entered into by the parties in Missouri, to be effective&nbsp; </p><p class="paragraph"> immediately.  </p>',
