          description: "refusal of recommended services",
          footer: "{{> 24TIvCaGrk93ukJYgPEQ }}",
          tags: ["job"],
          html: '<ion-grid style="font-size:14px">\r\n    <p><b style="font-size:18px">Refusal of Recommended Services</b></p>\r\n    <p style="padding-bottom: 20px">\r\n        I, {{job.customer.firstName}} {{job.customer.lastName}}, acknowledge that refusing recommended services can lead\r\n        to secondary damages and health\r\n        hazards including, but not limited to strong or severe odors in the property, warping and decay of building\r\n        materials, microorganism amplification,\r\n        and mold growth that can spread and could lead to serious health risk for all occupants in the building.\r\n    </p>\r\n    <p>The Flood Team recommends that all porous structural materials that have been affected\r\n        by Category 3 water be removed.\r\n    </p>\r\n    <article\r\n        style="text-align: justify;padding:20px; background-color: var(--ion-color-light-shade); margin-left:40px; margin-right:40px">\r\n        <b style="color: var(--ion-color-primary)">IIRC S500 Category 3 Contamination Definition:</b><br>\r\n        Category 3 water is grossly contaminated and can contains pathogenic, toxigenic, or other harmful\r\n        agents. Examples of Category 3 water sources can include, but are not limited to: sewage, toilet back\r\n        flows that originate from beyond the toilet trap regardless of visible content or color, all forms of flooding\r\n        from seawater, ground surface water and rising water from rivers or streams, and other contaminated\r\n        water entering or affecting the indoor environment, such as wind-driven rain from hurricanes, tropical\r\n        storms, or other weather-related events. Such water sources may carry silt, organic matter, pesticides,\r\n        heavy metals, regulated materials, or toxic organic substances.</p>\r\n    </article>\r\n    <p style="padding-top: 20px;">\r\n        Further, I agree to accept all liability for any such consequences stemming from my decision to not remove\r\n        contaminated materials affected by Category 3 water rather than follow The Flood Team and IICRC industry\r\n        standard practice\r\n        recommendation to remove the contaminated materials and follow any and all other sanitary cleaning procedures.\r\n    </p>\r\n</ion-grid>',
