                  preview: false,
                  html: '<p>Hi {{adjuster.firstName}},\r\n</p>\r\n<p>\r\n    We are emailing you because we were asked to send the scope of work as a courtesy of our mutual client, {{job.customer.firstName}} {{job.customer.lastName}} \r\n    {{job.claimNumber}}. Our goal is to get {{job.customer.firstName}} {{job.customer.lastName}} back to normal as quickly as possible. We want\r\n    you to be aware of the services we are providing based on IICRC Standards, the industry\'s professional recommendations for the\r\n    following loss. Please click here to review the following:\r\n</p>\r\n<ul>\r\n    <li>Scope of work</li>\r\n    <li>Photos</li>\r\n    <li>Initial Readings</li>\r\n    <li>Contracts</li>\r\n</ul>\r\n<p> Most water mitigation services are emergency in nature and according to IICRC S500\r\n    standards, water damage requires immediate action because water losses degrade overtime. To minimize and/or stop further damage, including the growth\r\n    of micro-organisms like bacteria and mold, work must start as soon as possible.\r\n</p>\r\n<p>We have attached the files mentioned above for your review. If you have questions regarding this project, please do\r\n    the following:\r\n</p>\r\n<a href="mailto:{{email.mine}}?cc={{email.cc}}">\r\n    <li>Email</li>\r\n</a>\r\n<p>We are obligated to keep the homeowner aware of all communication regarding this project and make this process as\r\ntransparent as possible so it is important that our client is included in all conversations. Please remember to CC our\r\nclient and "Reply All" in all corresponding emails to keep all parties informed and included.\r\n</p>\r\n<p>You can stay up to date on all of the latest job updates and more 24/7 on <a href>https://theflood.team/login</a>. Please login now to get\r\nstarted.</p>\r\n<p>Thank You!</p>\r\n<p>{{job.referral.firstName}} {{job.referral.lastName}}}</p>\r\n<p>(group email)</p>',
